import { IonButton, IonContent, IonGrid, IonHeader, IonImg, IonPage, IonRow, IonTitle, IonToolbar } from '@ionic/react';
import React from 'react';

import { auth } from '../firebase';

import '../css/Global.css';
import '../css/Home.css';
import gif from '../img/home/SIM Open House 2020 Banner.gif';

import TopNavMenu from '../components/TopNavMenu';
import Menu from '../components/Menu';
import TopNavBAMenu from '../components/TopNavBAMenu'

const Home: React.FC = () => {
  const handleLogout = async () => {
    await auth.signOut();
    sessionStorage.clear();
  };

  return (
    <IonPage>
      <TopNavBAMenu title="Home" route='/u/home' backarrow={ false } hamburger = { true }/>
      
      <IonContent fullscreen>
        <Menu />
        <IonImg src={ gif }></IonImg>
        <IonGrid>
          <IonRow className="ion-justify-content-around" id="openHouseMainRow">
            
          </IonRow>


          {/* <IonRow class="ion-justify-content-center">
            <IonButton type="submit" onClick={ handleLogout }>LOGOUT</IonButton>
          </IonRow> */}
        </IonGrid>
      </IonContent>
    </IonPage>
  );
};

export default Home;
